(3, 'Mimin', 'Bahas Petral, Tim Reformasi Tata Kelola Migas Lakukan Pertemuan dengan Pertamina dan Petral', '<p>\r\n JAKARTA &ndash; Bertempat di Gedung Sekretariat Jenderal, Kementerian Energi Dan Sumber Daya Mineral, Tim Reformasi Tata Kelola Minyak dan Gas Bumi lakukan pertemuan dengan Pertamina guna membahas keberadaan PT Petral. Tujuan pertemuan diungkapkan Ketua Tim Reformasi Tata Kelola Migas, Faisal Basri selain untuk meminta klarifikasi beberapa hal terkait keberadaan PT Petral anak Perusahaan PT Pertamina (Persero) juga membahas mengenai alur tata kelola kegiatan PT Pertamina. Rabu (17/12/2014).<br />\r\n <br />\r\n &ldquo; Kita meminta konfirmasi kepada Pertamina atas berbagai pertanyaan yang selama ini mengganggu Pertamina, dan juga sebaliknya. Pertaminakan juga bertanya-tanya juga tentang kita. Meski tidak ada kesimpulan, namun pertemuan ini akan sangat membantu kerja kami, terutama yang segera adalah tentang rekomendasi untuk formula harga patokan BBM terkait dengan subsidi&ldquo;, ujar Faisal dalam jumpa pers usai pertemuan.<br />\r\n <br />\r\n Kami lanjut Faisal banyak sekali medapat masukkan yang langsung sangat berguna dan mempermudah kerja kami untuk memberikan rekomendasi yang sejauh ini sudah mencapi 90 persen yang segera tahun ini juga akan kami serahkan kepada pemerintah.<br />\r\n <br />\r\n Sementara itu Vice President Corporate Communication PT Pertamina, Ali Mundakir menyatakan, Pertamina sudah memaparkan data-data kepada Tim Reformasi dan menurut saya, pertemuan ini merupakan sesuatu yang bagus dalam upaya untuk menciptakan iklim tata kelola industri migas yang baik.<br />\r\n <br />\r\n &ldquo;Prinsipnya Pertamina sangat mensupport semua data yang diperlukan oleh tim dan termasuk jika ada hal yang perlu didalami ataupun ada yang ingin dilihat langsung Tim reformasi&rdquo;, ujar Ali.<br />\r\n <br />\r\n Ali mengharapkan, &ldquo;semoga data dan informasi yang kami berikan berguna bagi tim, khususnya untuk menjalankan tugas-tugasnya menciptakan tata kelola migas yang lebih baik untuk Indonesia&rdquo;. (SF</p>\r\n', '2014-12-18 01:02:57'),
(4, 'Mimin', 'Soft Launching a 2050 Calculator for Indonesia ', '<p>\r\n JAKARTA &ndash; Dalam rangka mengembangkan a 2050 pathways calculator for Indonesia (I2050PC), Sekretaris Badan Penelitian Dan Pengembangan Kementerian Energi Dan Sumber Daya Mineral bekerjasama dengan Department of Energy and Climate Change (DECC) of the United Kingdom (unit Climate Change, British Embassy, Jakarta) melakukan soft launching a 2050 calculator for Indonesia. Soft launching dilakukan secara simbolis dengan pemukulan gong oleh Sekretaris Badan Litbang ESDM, Yanni Kussuryani didampingi Senior Energy Advisor UK Embassy, Paul Chambers. Rabu (17/12/2014).<br />\r\n <br />\r\n Launching bertujuan untuk memperkenalkan web-tools I2050 PC secara luas kepada para pemangku kepentingan (stakeholder) yang selanjutnya dapat digunakan sebagai masukkan bagi Kementerian ESDM terkait kebijakan dan skenario energi. Saran dan masukkan dapat pula berupa saran untuk penyempurnaan web-tool I2050PC itu sendiri.<br />\r\n Dalam sambutannya Yanni menguraikan bahwa dalam penyusunan I2050 PC ada tiga tahapan utama yang harus dilakukan, pertama penyusunan struktur model, pembuatan one pages, penyusunan exel spreadsheet dan integrasi web tools dan struktur model I2050PC secara umum dikembangkan oleh Tim Model dengan mengadopsi kebijakan energi nasional atau KEN sebagai referensi utama. &ldquo;Web tools I2050PC merupakan pemodelan interaktif berbasis web yang memungkinkan pengguna memilih skenario pembangunan sektor energi,&rdquo; ujar Yanni.<br />\r\n <br />\r\n &ldquo;Web tools I2050PC dapat diakses melalui website calculator2050.esdm.go.id/pathways,&rdquo; tambah Yanni.<br />\r\n <br />\r\n Dalam melakukan perencanaan energi di Indonesia telah dikenal beberapa jenis pemodelan, seperti pemodelan menggunakan perangkat lunak Long range Energy Alternatives Planning (LEAP) yang di dikembangkan oleh Stockholm Environment Institute di Boston (SEI Boston), Amerika Serikat, dan pemodelan menggunakan MARKAL (MARket Allocation), mengenai perbedaan pemodelan ini anggota Tim Pemodelan I2050PC, Aang Darmawan menjelaskan, pada dasarnya semua metode pemodelan itu sama, masing-masing memiliki kelebihan dan kekurangan. Kelebihan dari hasil pemodelan I2050PC ini selain open source, tampilan dari aplikasi ini yang ditayangkan dalam bentuk yang mudah dipahami oleh masyarakat, dimana pilihan-pilihan kebijakan itu dari skenario satu hingga empat itu ditampilkan.<br />\r\n <br />\r\n Masukkan dari masyarakat tersebut selanjutnya ditampung oleh pemerintah sebagai partisipasi publik, lanjut Aang.<br />\r\n <br />\r\n Rangkaian acara launching ditutup dengan talk show A2050 Calculator for Indonesia yang mengusung tema Proyeksi Pemanfaatan Energi Indonesia. Talk show menghadirkan empat narasumber, Rana Yusuf Nasir dari GBCI, Deputi Bidang Pengendalian Kerusakaan Lingkungan dan Perubahan Iklim, KLH, Prof, Danang Parikesit dari Pustral UGM dan Mickhael Putra dari PT Shell Indonesia. (SF)</p>\r\n', '2014-12-18 01:03:28'),
(5, 'Mimin', '1.595 Peserta Ikuti Tes Wawancara CPNS KESDM Tahun 2014', '<p>\r\n JAKARTA. Panitia Penerimaan Calon Pegawai Negri Sipil (CPNS) Kementerian ESDM tahun 2014. Pagi ini, mulai hari ini Senin (15/12/2014) hingga satu minggu mendatang melaksanakan tes wawancara kepada 1.595 peserta CPNS dinyatakan lulus dari test sebelumnya yaitu tes tertulis. Peserta wawancara atau tes kemampuan bidang (TKB) yang dinyatakan lulus akan diterima menjadi calon pegawai negeri sipil Kementerian ESDM.<br />\r\n <br />\r\n Peserta tes diwawancarai oleh kepala unit kerja yang dilamarnya, didampingi satu pewawancara dari unit lain yang membawahi bidang kepegawaian. Mengenai materi wawancara, sumber esdm.go.id yang juga Panitia Penerimaan CPNS Kementerian ESDM Tahun 2014 menuturkan, materi yang ditanyakan kepada peserta wawancara meliputi, kepribadian, intelektualitas, bagaimana dia menerapkan pekerjaannya bekerja sama dalam sebuah tim yang sesuai dengan dengan nilai-nilai Pancasila serta latar belakang pendidikan dan penguasaannya terhadap tupoksi kerja yang akan diembannya.<br />\r\n <br />\r\n Kementerian ESDM merupakan Kementerian teknis yang memiliki peran yang strategis dalam pengelolaan dan penentuan kebijakan bidang energi dan sumber daya mineral.&nbsp; Kebijakan yang dihasilkan berdampak secara langsung maupun tidak langsung terhadap kehidupan berbangsa dan negara, karena itu diperlukan sumber daya manusia yang handal, berkualitas dan profesional yang memiliki latar belakang pendidikan yang baik. Penguasaan terhadap bidang pekerjaan yang akan dijabatnya sangat diperlukan.<br />\r\n <br />\r\n Tes wawancara atau TKB merupakan rangkaian terakhir dari proses seleksi penerimaan CPNS. Tahun ini Kementerian ESDM menyediakan formasi untuk CPNS sebanyak 800 formasi. Dalam seluruh rangkaian proses seleksi Kementerian ESDM tidak memungut biaya apapun dan jika ada orang-orang yang mengatasnamakan panitia saringan seleksi penerimaan pegawai KESDM menjanjikan dapat diterima dengan syarat memberikan sejumlah uang, maka itu tidak benar. (SF)</p>\r\n', '2014-12-18 01:04:37'),
(6, 'Admin SKT', 'Badan Geologi Kirim Tim, Tinjau Bencana Tanah Longsor Banjarnegara', '<p>JAKARTA &ndash; Pusat Vilkanologi Dan Mitigasi Bencana Geologi (PVMBG),Badan Geologi, Kementerian Energi Dan Sumber Daya Mineral paska terjadinya bencana gerakan tanah longsor di Kabupaten Banjarnegara telah mengirimkan Tim Siaga Bencana untuk meninjau secara langsung dan melakukan penyelidikan guna mencari penyebab terjadinya gerakan tanah tersebut.<br /><br />Tim tanggap darurat bencana gerakan tanah sudah berada di lokasi bencana, untuk melakukan koordinasi dengan BNPB dan pemerintah daerah melalui BPBD dan melakukan pemeriksaan guna mengetahui penyebab terjadinya gerakan tanah, demikian dilaporkan Pusat Vulkanologi dan Mitigasi Bencana Geologi kepada esdm.go.id.<br /><br />Tim yang beranggotakan ahli-ahli geologi tersebut juga akan memberikan rekomendasi teknis penanganan bencana gerakan tanah, memberikan sosialisasi mengenai kondisi gerakan tanah yang telah terjadi kepada masyarakat yang terkena bencana dan juga melakukan kajian kelayakan huni di daerah sekitar bencana dan jika daerah bencana tidak layak huni, tim akan mencari lokasi yang aman untuk relokasi.<br /><br />Gerakan Tanah Desa Tunggoro, Kecamatan Sigaluh dan Desa Sidengok, Kecamatan Pejawaran, Kabupaten Banjarnegara, Provinsi Jawa Tengah, terjadi pada hari Kamis siang, 11 Desember 2014 pada pukul 11.00 WIB. Gerakan tanah yang terjadi diperkirakan berupa longsoran bahan rombakan pada tebing di tepi jalan.<br /><br />Daerah bencana dan sekitarnya menurut PVMBG merupakan daerah dengan kemiringan landai sampai terjal. Berdasarkan Peta Prakiraan Wilayah Terjadi Gerakan Tanah Provinsi Jawa Tengah bulan Desember 2014 (Badan Geologi, Pusat Vulkanologi dan Mitigasi Bencana Geologi), daerah tersebut termasuk zona potensi terjadi gerakan tanah Menengah sampai Tinggi artinya, daerah tersebut dapat terjadi gerakan tanah jika curah hujan di atas normal, terutama pada daerah yang berbatasan dengan lembah sungai, gawir, tebing jalan atau jika lereng mengalami gangguan tinggi, dan gerakan tanah lama dapat aktif kembali.<br /><br />PVMBG memperkirakan ada tiga faktor yang menjadi faktor penyebab terjadinya gerakan di lokasi bencana yaitu, morfologi daerah bencana dan sekitarnya yang secara umum berupa perbukitan dengan kemiringan landai hingga terjal.Litologi yang diperkirakan bersifat sarang dengan daya resap air yang tinggi, yaitu berupa lahar dan endapan alluvium dari bahan rombakan gunungapi, aliran lava dan breksi, dengan batuan dasar yang berupa aglomerat bersusunan andesit, lava andesit hornblenda dan tuf dan Curah hujan yang tinggi dan lama pada saat dan sebelum kejadian gerakan tanah. (SF)</p>', '2015-01-12 10:14:05');
