INSERT INTO `ref_template_skt` (`id_template_skt`, `nama_template`, `head`, `body1`, `body2`, `body3`, `body4`, `body5`, `foot`) VALUES
(1, 'Konsep Dokumen SKT 1', '<p style="text-align:center"><strong>KEMENTERIAN ENERGI DAN SUMBER DAYA MINERAL REPUBLIK INDONESIA</strong><br /> <strong>DIREKTORAT JENDERAL MINYAK DAN GAS BUMI<br /> SURAT KETERANGAN TERDAFTAR</strong><br /> No.&nbsp;&nbsp;', '</p>  <p><br /> Memperhatikan surat Permohonan Pendaftaran Perusahaan Usaha Penunjang Minyak dan Gas Bumi Nomor: 25/ML/X/2014 tanggal 27 Oktober 2014 dan berdasarkan:<br /> <br /> 1.&nbsp;&nbsp; &nbsp;Undang-Undang Republik Indonesia Nomor 22 Tahun 2001;<br /> 2.&nbsp;&nbsp; &nbsp;Peraturan Pemerintah Republik Indonesia&nbsp; Nomor 17 Tahun 1974;<br /> 3.&nbsp;&nbsp; &nbsp;Peraturan Pemerintah Republik Indonesia&nbsp; Nomor 11 Tahun 1979;<br /> 4.&nbsp;&nbsp; &nbsp;Peraturan Pemerintah Republik Indonesia&nbsp; Nomor 35 Tahun 2004;<br /> 5.&nbsp;&nbsp; &nbsp;Peraturan Pemerintah Republik Indonesia&nbsp; Nomor 36 Tahun 2004;<br /> 6.&nbsp;&nbsp; &nbsp;Peraturan Menteri Energi dan Sumber Daya Mineral Nomor 1457.K/28/MEM/2000;<br /> 7.&nbsp;&nbsp; &nbsp;Peraturan Menteri Energi dan Sumber Daya Mineral Nomor&nbsp; 27 Tahun 2008; dan<br /> 8.&nbsp;&nbsp; &nbsp;Keputusan Direktur Jenderal Minyak dan Gas Bumi Nomor: 15784.K/10/DJM.S/2010.</p>  <p style="text-align:center"><strong>DIREKTUR JENDERAL MINYAK DAN GAS BUMI</strong></p>  <p>dengan ini memberikan Surat Keterangan Terdaftar kepada:<br /> Nama perusahaan&nbsp;&nbsp;&nbsp;&nbsp;: <strong>', '</strong><br /> Alamat&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;: ', '<br /> &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br /> sebagai perusahaan usaha penunjang pada kegiatan usaha minyak dan gas bumi dengan klasifikasi bidang usaha: ', '<p>Surat Keterangan Terdaftar diberikan dengan ketentuan sebagai berikut:<br /> 1.&nbsp;&nbsp; &nbsp;Dalam melaksanakan kegiatan usahanya, wajib mengikuti ketentuan peraturan perundang-<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; undangan yang berlaku.<br /> 2.&nbsp;&nbsp; &nbsp;Mengutamakan penggunaan barang dan jasa produksi dalam negeri.<br /> 3.&nbsp;&nbsp; &nbsp;Mengutamakan penggunaan tenaga kerja Indonesia dan wajib melaksanakan program<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; pengembangan tenaga kerja Indonesia.<br /> 4.&nbsp;&nbsp; &nbsp;Menyampaikan laporan kegiatan usaha perusahaan secara berkala setiap enam bulan sekali<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; kepada Direktur Teknik dan Lingkungan Migas untuk dilakukan evaluasi dan verifikasi.<br /> 5.&nbsp;&nbsp; &nbsp;Terhadap <strong>', '</strong> dapat dikenakan sanksi berupa teguran tertulis dan/atau<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; pencabutan Surat Keterangan Terdaftar apabila melakukan pelanggaran terhadap ketentuan<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; peraturan perundang-undangan serta tidak mematuhi kewajiban-kewajiban yang telah ditentukan<br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; dalam Surat Keterangan Terdaftar ini.<br /> 6.&nbsp;&nbsp; &nbsp;Surat Keterangan Terdaftar ini berlaku selama <b>3 (tiga) tahun</b> sejak tanggal dikeluarkan dan dapat &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; diperpanjang.<br /> &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Dikeluarkan di Jakarta<br /> &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pada tanggal&nbsp;&nbsp;', '&nbsp; &nbsp;<br /> <strong>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>a.n.&nbsp;&nbsp; &nbsp;Direktur Jenderal Minyak dan Gas Bumi</strong><br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>Direktur Teknik dan Lingkungan Migas</strong></p>  <p><br /> <br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Ir. Edi Purnomo</strong><br /> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>NIP. 19561204 198403 1 001&nbsp;&nbsp;</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;</p>');
