(6, 20, '06/SKT-01/DMT/2015', '<p style="text-align:center"><strong>KEMENTERIAN ENERGI DAN SUMBER DAYA MINERAL REPUBLIK INDONESIA</strong><br /><strong>DIREKTORAT JENDERAL MINYAK DAN GAS BUMI<br />SURAT KETERANGAN TERDAFTAR</strong><br />No.&nbsp;&nbsp;06/SKT-01/DMT/2015</p><p><br />Memperhatikan surat Permohonan Pendaftaran Perusahaan Usaha Penunjang Minyak dan Gas Bumi Nomor: 25/ML/X/2014 tanggal 27 Oktober 2014 dan berdasarkan:<br /><br />1.&nbsp;&nbsp; &nbsp;Undang-Undang Republik Indonesia Nomor 22 Tahun 2001;<br />2.&nbsp;&nbsp; &nbsp;Peraturan Pemerintah Republik Indonesia&nbsp; Nomor 17 Tahun 1974;<br />3.&nbsp;&nbsp; &nbsp;Peraturan Pemerintah Republik Indonesia&nbsp; Nomor 11 Tahun 1979;<br />4.&nbsp;&nbsp; &nbsp;Peraturan Pemerintah Republik Indonesia&nbsp; Nomor 35 Tahun 2004;<br />5.&nbsp;&nbsp; &nbsp;Peraturan Pemerintah Republik Indonesia&nbsp; Nomor 36 Tahun 2004;<br />6.&nbsp;&nbsp; &nbsp;Peraturan Menteri Energi dan Sumber Daya Mineral Nomor 1457.K/28/MEM/2000;<br />7.&nbsp;&nbsp; &nbsp;Peraturan Menteri Energi dan Sumber Daya Mineral Nomor&nbsp; 27 Tahun 2008; dan<br />8.&nbsp;&nbsp; &nbsp;Keputusan Direktur Jenderal Minyak dan Gas Bumi Nomor: 15784.K/10/DJM.S/2010.</p><p style="text-align:center"><strong>DIREKTUR JENDERAL MINYAK DAN GAS BUMI</strong></p><p>dengan ini memberikan Surat Keterangan Terdaftar kepada:<br />Nama perusahaan&nbsp;&nbsp;&nbsp;&nbsp;: <strong>PT Karya Wijaya</strong><br />Alamat&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;: Jl. Kapten Tendean<br />&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />sebagai perusahaan usaha penunjang pada kegiatan usaha minyak dan gas bumi dengan klasifikasi bidang usaha: <strong>Jasa Konstruksi</strong> subbidang <strong>Pengawasan Konstruksi</strong> dengan bagian subbidang:</p><table align="center" border="1" bordercolor="#000" cellpadding="5" cellspacing="0" style="border-collapse:collapse"> <tbody>  <tr>   <td>Layanan Jasa Inspeksi Teknis</td>   <td>Jasa Baru,</td>  </tr>  <tr>   <td>Layanan Jasa Manajemen Proyek</td>   <td>Jasa Manajemen Proyek Terkait Konstruksi Pekerjaan Teknik Sipil Transportasi, Jasa Lainnya,</td>  </tr> </tbody></table><p>Surat Keterangan Terdaftar diberikan dengan ketentuan sebagai berikut:<br />1.&nbsp;&nbsp; &nbsp;Dalam melaksanakan kegiatan usahanya, wajib mengikuti ketentuan peraturan perundang-<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;undangan yang berlaku.<br />2.&nbsp;&nbsp; &nbsp;Mengutamakan penggunaan barang dan jasa produksi dalam negeri.<br />3.&nbsp;&nbsp; &nbsp;Mengutamakan penggunaan tenaga kerja Indonesia dan wajib melaksanakan program<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; pengembangan tenaga kerja Indonesia.<br />4.&nbsp;&nbsp; &nbsp;Menyampaikan laporan kegiatan usaha perusahaan secara berkala setiap enam bulan sekali<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; kepada Direktur Teknik dan Lingkungan Migas untuk dilakukan evaluasi dan verifikasi.<br />5.&nbsp;&nbsp; &nbsp;Terhadap <strong>PT Karya Wijaya</strong> dapat dikenakan sanksi berupa teguran tertulis dan/atau<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; pencabutan Surat Keterangan Terdaftar apabila melakukan pelanggaran terhadap ketentuan<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; peraturan perundang-undangan serta tidak mematuhi kewajiban-kewajiban yang telah ditentukan<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; dalam Surat Keterangan Terdaftar ini.<br />6.&nbsp;&nbsp; &nbsp;Surat Keterangan Terdaftar ini berlaku selama <strong>3 (tiga) tahun</strong> sejak tanggal dikeluarkan dan dapat &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; diperpanjang.<br />&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Dikeluarkan di Jakarta<br />&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pada tanggal&nbsp;&nbsp;17 Januari 2015&nbsp; &nbsp;<br /><strong>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>a.n.&nbsp;&nbsp; &nbsp;Direktur Jenderal Minyak dan Gas Bumi</strong><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>Direktur Teknik dan Lingkungan Migas</strong></p><p><br /><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Ir. Edi Purnomo</strong><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>NIP. 19561204 198403 1 001&nbsp;&nbsp;</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;</p>', 2, '2015-01-18'),
(10, 22, '07/SKT-02/DMT/2015', '<p style="text-align:center"><strong>KEMENTERIAN ENERGI DAN SUMBER DAYA MINERAL REPUBLIK INDONESIA</strong><br /><strong>DIREKTORAT JENDERAL MINYAK DAN GAS BUMI<br />SURAT KETERANGAN TERDAFTAR</strong><br />No.&nbsp;&nbsp;07/SKT-02/DMT/2015</p><p><br />Memperhatikan surat Permohonan Pendaftaran Perusahaan Usaha Penunjang Minyak dan Gas Bumi Nomor: 25/ML/X/2014 tanggal 27 Oktober 2014 dan berdasarkan:<br /><br />1.&nbsp;&nbsp; &nbsp;Undang-Undang Republik Indonesia Nomor 22 Tahun 2001;<br />2.&nbsp;&nbsp; &nbsp;Peraturan Pemerintah Republik Indonesia&nbsp; Nomor 17 Tahun 1974;<br />3.&nbsp;&nbsp; &nbsp;Peraturan Pemerintah Republik Indonesia&nbsp; Nomor 11 Tahun 1979;<br />4.&nbsp;&nbsp; &nbsp;Peraturan Pemerintah Republik Indonesia&nbsp; Nomor 35 Tahun 2004;<br />5.&nbsp;&nbsp; &nbsp;Peraturan Pemerintah Republik Indonesia&nbsp; Nomor 36 Tahun 2004;<br />6.&nbsp;&nbsp; &nbsp;Peraturan Menteri Energi dan Sumber Daya Mineral Nomor 1457.K/28/MEM/2000;<br />7.&nbsp;&nbsp; &nbsp;Peraturan Menteri Energi dan Sumber Daya Mineral Nomor&nbsp; 27 Tahun 2008; dan<br />8.&nbsp;&nbsp; &nbsp;Keputusan Direktur Jenderal Minyak dan Gas Bumi Nomor: 15784.K/10/DJM.S/2010.</p><p style="text-align:center"><strong>DIREKTUR JENDERAL MINYAK DAN GAS BUMI</strong></p><p>dengan ini memberikan Surat Keterangan Terdaftar kepada:<br />Nama perusahaan&nbsp;&nbsp;&nbsp;&nbsp;: <strong>PT Karya Wijaya</strong><br />Alamat&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;: Jl. Kapten Tendean<br />&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />sebagai perusahaan usaha penunjang pada kegiatan usaha minyak dan gas bumi dengan klasifikasi bidang usaha: <strong>Jasa Non Konstruksi</strong> subbidang <strong>Inspeksi Teknis</strong> dengan bagian subbidang:</p><table align="center" border="1" cellpadding="5" cellspacing="0" style="border-collapse:collapse"><tbody><tr><td>Inspeksi Teknis Statutory</td><td>Inspeksi Teknis Peralatan Lingkungan, Inspeksi Teknis Peralatan Putar (Rotating Equipment),</td></tr><tr><td>Inspeksi Teknis Voluntary</td><td>Inspeksi Teknis Peralatan Lingkungan, Inspeksi Teknis Instalasi ,</td></tr></tbody></table><p>Surat Keterangan Terdaftar diberikan dengan ketentuan sebagai berikut:<br />1.&nbsp;&nbsp; &nbsp;Dalam melaksanakan kegiatan usahanya, wajib mengikuti ketentuan peraturan perundang-<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;undangan yang berlaku.<br />2.&nbsp;&nbsp; &nbsp;Mengutamakan penggunaan barang dan jasa produksi dalam negeri.<br />3.&nbsp;&nbsp; &nbsp;Mengutamakan penggunaan tenaga kerja Indonesia dan wajib melaksanakan program<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; pengembangan tenaga kerja Indonesia.<br />4.&nbsp;&nbsp; &nbsp;Menyampaikan laporan kegiatan usaha perusahaan secara berkala setiap enam bulan sekali<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; kepada Direktur Teknik dan Lingkungan Migas untuk dilakukan evaluasi dan verifikasi.<br />5.&nbsp;&nbsp; &nbsp;Terhadap <strong>PT Karya Wijaya</strong> dapat dikenakan sanksi berupa teguran tertulis dan/atau<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; pencabutan Surat Keterangan Terdaftar apabila melakukan pelanggaran terhadap ketentuan<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; peraturan perundang-undangan serta tidak mematuhi kewajiban-kewajiban yang telah ditentukan<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; dalam Surat Keterangan Terdaftar ini.<br />6.&nbsp;&nbsp; &nbsp;Surat Keterangan Terdaftar ini berlaku selama <strong>3 (tiga) tahun</strong> sejak tanggal dikeluarkan dan dapat &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; diperpanjang.<br />&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Dikeluarkan di Jakarta<br />&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pada tanggal&nbsp;&nbsp;18 Januari 2015&nbsp; &nbsp;<br /><strong>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>a.n.&nbsp;&nbsp; &nbsp;Direktur Jenderal Minyak dan Gas Bumi</strong><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>Direktur Teknik dan Lingkungan Migas</strong></p><p><br /><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Ir. Edi Purnomo</strong><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>NIP. 19561204 198403 1 001&nbsp;&nbsp;</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;</p>', 2, '2015-01-18'),
(11, 35, '000/SKT-03/DMT/2015', '<p style="text-align:center"><strong>KEMENTERIAN ENERGI DAN SUMBER DAYA MINERAL REPUBLIK INDONESIA</strong><br />\r\n<strong>DIREKTORAT JENDERAL MINYAK DAN GAS BUMI<br />\r\nSURAT KETERANGAN TERDAFTAR</strong><br />\r\nNo.&nbsp;&nbsp;000/SKT-03/DMT/2015</p>\r\n\r\n<p><br />\r\nMemperhatikan surat Permohonan Pendaftaran Perusahaan Usaha Penunjang Minyak dan Gas Bumi Nomor: 25/ML/X/2014 tanggal 27 Oktober 2014 dan berdasarkan:<br />\r\n<br />\r\n1.&nbsp;&nbsp; &nbsp;Undang-Undang Republik Indonesia Nomor 22 Tahun 2001;<br />\r\n2.&nbsp;&nbsp; &nbsp;Peraturan Pemerintah Republik Indonesia&nbsp; Nomor 17 Tahun 1974;<br />\r\n3.&nbsp;&nbsp; &nbsp;Peraturan Pemerintah Republik Indonesia&nbsp; Nomor 11 Tahun 1979;<br />\r\n4.&nbsp;&nbsp; &nbsp;Peraturan Pemerintah Republik Indonesia&nbsp; Nomor 35 Tahun 2004;<br />\r\n5.&nbsp;&nbsp; &nbsp;Peraturan Pemerintah Republik Indonesia&nbsp; Nomor 36 Tahun 2004;<br />\r\n6.&nbsp;&nbsp; &nbsp;Peraturan Menteri Energi dan Sumber Daya Mineral Nomor 1457.K/28/MEM/2000;<br />\r\n7.&nbsp;&nbsp; &nbsp;Peraturan Menteri Energi dan Sumber Daya Mineral Nomor&nbsp; 27 Tahun 2008; dan<br />\r\n8.&nbsp;&nbsp; &nbsp;Keputusan Direktur Jenderal Minyak dan Gas Bumi Nomor: 15784.K/10/DJM.S/2010.</p>\r\n\r\n<p style="text-align:center"><strong>DIREKTUR JENDERAL MINYAK DAN GAS BUMI</strong></p>\r\n\r\n<p>dengan ini memberikan Surat Keterangan Terdaftar kepada:<br />\r\nNama perusahaan&nbsp;&nbsp;&nbsp;&nbsp;: <strong>PT. Lintas Arta</strong><br />\r\nAlamat&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;: Jl. Argaraya<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\r\nsebagai perusahaan usaha penunjang pada kegiatan usaha minyak dan gas bumi dengan klasifikasi bidang usaha: <strong>Industri Penunjang</strong> subbidang <strong>Industri Material</strong> dengan bagian subbidang:</p>\r\n\r\n<table align="center" border="1" bordercolor="#000" cellpadding="5" cellspacing="0" style="border-collapse:collapse">\r\n <tbody>\r\n  <tr>\r\n   <td>Material Fluida Pemboran, antara lain: Bentonite, Barite, Carboxymethyl Cellulose</td>\r\n   <td>&nbsp;</td>\r\n  </tr>\r\n  <tr>\r\n   <td>Material Fluida Pemboran, antara lain: Bentonite, Barite, Carboxymethyl Cellulose, Material Bahan Radioaktif</td>\r\n   <td>&nbsp;</td>\r\n  </tr>\r\n  <tr>\r\n   <td>Material Fluida Pemboran, antara lain: Bentonite, Barite, Carboxymethyl Cellulose, Material Bahan Radioaktif, Material Bahan Peledak</td>\r\n   <td>&nbsp;</td>\r\n  </tr>\r\n </tbody>\r\n</table>\r\n\r\n<p>Surat Keterangan Terdaftar diberikan dengan ketentuan sebagai berikut:<br />\r\n1.&nbsp;&nbsp; &nbsp;Dalam melaksanakan kegiatan usahanya, wajib mengikuti ketentuan peraturan perundang-<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; undangan yang berlaku.<br />\r\n2.&nbsp;&nbsp; &nbsp;Mengutamakan penggunaan barang dan jasa produksi dalam negeri.<br />\r\n3.&nbsp;&nbsp; &nbsp;Mengutamakan penggunaan tenaga kerja Indonesia dan wajib melaksanakan program<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; pengembangan tenaga kerja Indonesia.<br />\r\n4.&nbsp;&nbsp; &nbsp;Menyampaikan laporan kegiatan usaha perusahaan secara berkala setiap enam bulan sekali<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; kepada Direktur Teknik dan Lingkungan Migas untuk dilakukan evaluasi dan verifikasi.<br />\r\n5.&nbsp;&nbsp; &nbsp;Terhadap <strong>PT. Lintas Arta</strong> dapat dikenakan sanksi berupa teguran tertulis dan/atau<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; pencabutan Surat Keterangan Terdaftar apabila melakukan pelanggaran terhadap ketentuan<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; peraturan perundang-undangan serta tidak mematuhi kewajiban-kewajiban yang telah ditentukan<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; dalam Surat Keterangan Terdaftar ini.<br />\r\n6.&nbsp;&nbsp; &nbsp;Surat Keterangan Terdaftar ini berlaku selama <strong>3 (tiga) tahun</strong> sejak tanggal dikeluarkan dan dapat &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; diperpanjang.<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Dikeluarkan di Jakarta<br />\r\n&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pada tanggal&nbsp;&nbsp;04 Maret 2015&nbsp; &nbsp;<br />\r\n<strong>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>a.n.&nbsp;&nbsp; &nbsp;Direktur Jenderal Minyak dan Gas Bumi</strong><br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>Direktur Teknik dan Lingkungan Migas</strong></p>\r\n\r\n<p><br />\r\n<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Ir. Edi Purnomo</strong><br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>NIP. 19561204 198403 1 001&nbsp;&nbsp;</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;</p>\r\n', 0, NULL);
